import React from "react";
import {
  Typography,
  Box,
  Tabs,
  Tab,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Chip,
  useMediaQuery,
  useTheme,
  List,
  ListItem,
  ListItemText,
  Divider,
  Stack
} from "@mui/material";

// Sample data
const sampleOrders = [
  { 
    id: "12345", 
    symbol: "RELIANCE", 
    type: "BUY", 
    quantity: 5, 
    price: 2450.75, 
    status: "COMPLETE", 
    time: "10:30 AM", 
    date: "2023-06-15" 
  },
  { 
    id: "12346", 
    symbol: "INFY", 
    type: "SELL", 
    quantity: 10, 
    price: 1675.50, 
    status: "PENDING", 
    time: "11:15 AM", 
    date: "2023-06-15" 
  },
  { 
    id: "12347", 
    symbol: "HDFCBANK", 
    type: "BUY", 
    quantity: 2, 
    price: 1565.25, 
    status: "REJECTED", 
    time: "09:45 AM", 
    date: "2023-06-15" 
  },
  { 
    id: "12348", 
    symbol: "TCS", 
    type: "SELL", 
    quantity: 1, 
    price: 3450.00, 
    status: "COMPLETE", 
    time: "02:30 PM", 
    date: "2023-06-14" 
  },
  { 
    id: "12349", 
    symbol: "TATASTEEL", 
    type: "BUY", 
    quantity: 8, 
    price: 1240.75, 
    status: "COMPLETE", 
    time: "03:15 PM", 
    date: "2023-06-14" 
  }
];

const Orders = () => {
  const [tabValue, setTabValue] = useState(0);
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('md'));

  const handleTabChange = (event, newValue) => {
    setTabValue(newValue);
  };

  const getStatusColor = (status) => {
    switch (status) {
      case "COMPLETE":
        return "success";
      case "PENDING":
        return "warning";
      case "REJECTED":
        return "error";
      default:
        return "default";
    }
  };

  const getTypeColor = (type) => {
    return type === "BUY" ? "primary" : "error";
  };

  return (
    <Box sx={{ p: { xs: 0.5, sm: 1, md: 2 } }}>
      <Typography variant="h5" gutterBottom sx={{ fontSize: { xs: '1.2rem', sm: '1.5rem' } }}>
        Orders
      </Typography>

      <Box sx={{ borderBottom: 1, borderColor: 'divider', mb: 2 }}>
        <Tabs 
          value={tabValue} 
          onChange={handleTabChange} 
          aria-label="order tabs"
          variant={isMobile ? "fullWidth" : "standard"}
        >
          <Tab label="Open Orders" />
          <Tab label="Executed" />
          <Tab label="Trade Book" />
        </Tabs>
      </Box>

      {/* Desktop view - Table */}
      {!isMobile && (
        <TableContainer component={Paper}>
          <Table size="small" aria-label="orders table">
            <TableHead>
              <TableRow>
                <TableCell>Time</TableCell>
                <TableCell>Type</TableCell>
                <TableCell>Symbol</TableCell>
                <TableCell>Quantity</TableCell>
                <TableCell>Price</TableCell>
                <TableCell>Status</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {sampleOrders.map((order) => (
                <TableRow key={order.id}>
                  <TableCell>{order.time}</TableCell>
                  <TableCell>
                    <Chip 
                      label={order.type} 
                      color={getTypeColor(order.type)} 
                      size="small" 
                      variant="outlined"
                    />
                  </TableCell>
                  <TableCell>{order.symbol}</TableCell>
                  <TableCell>{order.quantity}</TableCell>
                  <TableCell>{order.price.toFixed(2)}</TableCell>
                  <TableCell>
                    <Chip 
                      label={order.status} 
                      color={getStatusColor(order.status)} 
                      size="small"
                    />
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      )}

      {/* Mobile view - List */}
      {isMobile && (
        <List sx={{ width: '100%', bgcolor: 'background.paper' }}>
          {sampleOrders.map((order, index) => (
            <React.Fragment key={order.id}>
              <ListItem alignItems="flex-start">
                <ListItemText
                  primary={
                    <Stack direction="row" justifyContent="space-between" alignItems="center">
                      <Typography variant="subtitle1">{order.symbol}</Typography>
                      <Chip 
                        label={order.status} 
                        color={getStatusColor(order.status)} 
                        size="small"
                      />
                    </Stack>
                  }
                  secondary={
                    <Box sx={{ mt: 1 }}>
                      <Stack direction="row" justifyContent="space-between" sx={{ mb: 0.5 }}>
                        <Chip 
                          label={order.type} 
                          color={getTypeColor(order.type)} 
                          size="small" 
                          variant="outlined"
                        />
                        <Typography variant="body2">{order.time}</Typography>
                      </Stack>
                      <Stack direction="row" justifyContent="space-between">
                        <Typography variant="body2">Qty: {order.quantity}</Typography>
                        <Typography variant="body2">â‚¹{order.price.toFixed(2)}</Typography>
                      </Stack>
                    </Box>
                  }
                />
              </ListItem>
              {index < sampleOrders.length - 1 && <Divider component="li" />}
            </React.Fragment>
          ))}
        </List>
      )}
    </Box>
  );
};

export default Orders;
